import logo from './logo.svg';
import './App.css';

const Header= () => {
return (
<h1>Hello! Just testing!</h1>
);
};

const Home = () => {};
const Products = () => {};
const Company = () => {};

function App() {
  return (<div>
    <Header />
    <Switch>
      <Route exact path="/">
        <Home />
      </Route>
      <Route path="/products">
        <Products/>
      </Route>
      <Route path="/company">
        <Company />
      </Route>
    </Switch>
  </div>

  );
}

export default App;
